        public void linkActive()
{
    this.query().validTimeStateAsOfDateTime(custPackingSlipVersion.VersionDateTime);
    isVersionArchived = custPackingSlipVersion.isArchived();

    super();
}

internal boolean twoRowsSelected()
{
    Common item = this.getFirst(1);
    int cnt = 0;

    while (item && cnt<3)
    {
        cnt++;
        item = this.getNext();
    }

    return (cnt == 2);
}
